    [],nt"revision_timestamp": "2016-05-20T00:44:41.143390",nt"name": "kimama-well-borehole-geophysics-database",nt"isopen":
    true,nt"url": null,nt"notes": "The Snake River Plain (SRP), Idaho, hosts
    potential geothermal resources due to elevated groundwater temperatures associated
    with the thermal anomaly Yellowstone-Snake River hotspot. Project HOTSPOT has coordinated
    international institutions and organizations to understand subsurface stratigraphy
    and assess geothermal potential. Over 5.9km of core were drilled from three boreholes
    within the SRP in an attempt to acquire continuous core documenting the volcanic
    and sedimentary record of the hotspot: (1) Kimama, (2) Kimberly, and (3) Mountain
    Home. The Kimama drill site was set up to acquire a continuousnrecord of basaltic
    volcanism along the central volcanic axis and to test the extent of geothermal resources
    beneath the Snake River aquifer.nData submitted by project collaborator Doug Schmitt,
    University of Alberta",nt"license_title": "Creative Commons Attribution",nt"extras":
